[addLiquidity]
k: #execute => #halt
statusCode: _ => _
output: _ => _
callData: #abiCallData("addLiquidity", #uint256(MIN_LIQUID), #uint256(MAX_TOKEN), #uint256(DEADLINE))
callValue: CALL_VALUE
log: _ => _
refund: _ => _
balance: BAL
storage:
    (#hashedLocation({COMPILER}, {_TOTAL_SUPPLY}, .IntList) |-> TOTAL_SUPPLY
    #hashedLocation({COMPILER}, {_BALANCES}, CALLER_ID) |-> CALLER_BAL
    #hashedLocation({COMPILER}, {_TOKEN}, .IntList) |-> TOKEN_ADDR
    #hashedLocation({COMPILER}, {_FACTORY}, .IntList) |-> FACTORY_ADDR
    _:Map) => _:Map
requires:
    andBool #rangeUInt(256, MIN_LIQUID)
    andBool #rangeUInt(256, MAX_TOKEN)
    andBool #rangeUInt(256, DEADLINE)
    andBool #rangeUInt(256, CALL_VALUE)
    andBool #rangeUInt(256, BAL)
    andBool #rangeUInt(256, TOTAL_SUPPLY)
    andBool #rangeUInt(256, CALLER_BAL)
    andBool #rangeAddress(TOKEN_ADDR)
    andBool #rangeAddress(FACTORY_ADDR)
    andBool ACCT_ID =/=Int TOKEN_ADDR
    andBool ACCT_ID =/=Int FACTORY_ADDR
    andBool TOKEN_ADDR =/=Int FACTORY_ADDR

[addLiquidity-1]
+requires:
    andBool 0 <Int TOTAL_SUPPLY
    andBool CALL_VALUE <Int BAL

[addLiquidity-2]
+requires:
    andBool 0 ==Int TOTAL_SUPPLY
    andBool CALL_VALUE <=Int BAL

