    #hashedLocation({COMPILER}, {_BALANCES}, CALLER_ID) |-> CALLER_BAL
    #hashedLocation({COMPILER}, {_TOKEN}, .IntList) |-> TOKEN_ADDR
    _:Map) => _:Map
requires:
    andBool #rangeUInt(256, LIQUID_AMOUNT)
    andBool #rangeUInt(256, MIN_ETH)
    andBool #rangeUInt(256, MIN_TOKEN)
    andBool #rangeUInt(256, DEADLINE)
    andBool #rangeUInt(256, CALL_VALUE)
    andBool #rangeUInt(256, BAL)
    andBool #rangeUInt(256, TOTAL_SUPPLY)
    andBool #rangeUInt(256, CALLER_BAL)
    andBool #rangeAddress(TOKEN_ADDR)
    andBool ACCT_ID =/=Int TOKEN_ADDR

